import React from 'react';
import TodoListItem from './TodoListItem.js';

const TodoList = ({data}) =>
{
	const items = ['Дело 1', 'Дело 2', 'Дело 3'];
	return(
		<ul>
			<li><TodoListItem label={data[0].label} important={data[0].important}/></li>
			<li><TodoListItem label={data[1].label} important={data[1].important}/></li>
			<li><TodoListItem label={data[2].label} important={data[2].important}/></li>
		</ul>
	);
};

export default TodoList;
